import React from 'react'
import styled from "styled-components";

const StyledBanner = styled.div`
/* background: #000000; */
background-color: #fff;
mix-blend-mode: darken;
opacity: 0.3;
border-radius: 25px;
height: 250px;
width: 80%;
`

export default function Banner() {
  return (
    <div>
        <StyledBanner>
            <p>Text</p>
        </StyledBanner>
    </div>
  )
}
